import React, { Component } from "react";
import { Breadcrumb } from "@gull";
import { Table } from "react-bootstrap";
import ReactPaginate from "react-paginate";
import SimpleCard from "@gull/components/cards/SimpleCard";
import { classList } from "@utils";

class BlankPage extends Component {
  state = {
    newUserList: [
      {
        name: "David Hopkins",
        email: "hopkins@gmail.com",
        photoUrl: "/assets/images/faces/2.jpg",
        status: "active",
      },
      {
        name: "James Mitchell",
        email: "petter@gmail.com",
        photoUrl: "/assets/images/faces/3.jpg",
        status: "pending",
      },
      {
        name: "Jessica Mitchell",
        email: "johndoe@gmail.com",
        photoUrl: "/assets/images/faces/4.jpg",
        status: "inactive",
      },
    ],
    topProductList: [
      {
        name: "Watch",
        date: "12-10-2019",
        price: 30,
        status: "delivered",
      },
      {
        name: "Iphone",
        date: "24-10-2019",
        price: 350,
        status: "pending",
      },
      {
        name: "Headphone",
        date: "11-11-2019",
        price: 10,
        status: "not delivered",
      },
    ],
  };

  setOpenItem = (name) => {
    if (name === this.state.openItem) {
      this.setState({ openItem: "" });
    } else this.setState({ openItem: name });
  };

  handlePageClick = (data) => {
    let pageNumber = data.selected;
    let offset = Math.ceil(pageNumber * this.props.perPage);
    this.setState({ offset: offset }, () => {
      console.log(data);
    });
  };

  getUserStatusClass = (status) => {
    switch (status) {
      case "active":
        return "bg-success";
      case "delivered":
        return "bg-success";
      case "inactive":
        return "bg-warning";
      case "not delivered":
        return "bg-warning";
      case "pending":
        return "bg-primary";
      default:
        break;
    }
  };

  getStatusTextColor = (status) => {
    switch (status) {
      case "In Stock":
        return "text-success";
      case "Low Stock":
        return "text-warning";
      case "Out of Stock":
        return "text-danger";
      default:
        return "text-primary";
    }
  };

  render() {
    let {
      newUserList = [],
      topProductList = [],
    } = this.state;


    return (
      <div>
        <Breadcrumb
          routeSegments={[
            { name: "Home", path: "/" },
            { name: "Pages", path: "/pages" },
            { name: "12M Operator's App" },
          ]}
        ></Breadcrumb>
        <div className="row">
          <div className="col-md-12">
            <div className="card mb-4">
              <div className="card-header card-title mb-0 d-flex align-items-center justify-content-between border-0">
                <h3 className="w-50 float-left card-title m-0">
                  12M Log
                </h3>
                <Dropdown>
                  <Dropdown.Toggle
                    as="span"
                    className="toggle-hidden cursor-pointer"
                  >
                    <i className="nav-icon i-Gear-2"></i>
                  </Dropdown.Toggle>
                  <Dropdown.Menu>
                    <Dropdown.Item>Add new Entry</Dropdown.Item>
                    <Dropdown.Item>View All Entries</Dropdown.Item>
                    <Dropdown.Item>Something else here</Dropdown.Item>
                  </Dropdown.Menu>
                </Dropdown>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default BlankPage;
